nta.declaration:
//{1,0,0,0} -> N_xRF, S_xRF 
//{0,1,0,0} -> N_Lxx, S_Lxx
//{0,0,1,0} -> E_lRF, W_lRF
//{0,0,0,1} -> E_Lxx, W_Lxx

// state variables
const int L = 3; // number of lanes with differen maneuvers per road 
int A[L] = {4, 0, 2}; //{3, 5, 3};
int B[L] = {2, 4, 0}; //{1, 7, 0};
clock x = 0.0;

// disturbances
const int p_move_add[L] = {0, 0, 0};
const int rAdd=0, rRemA=1, rRemB=1;

// communication between phases
const int N = 4; // number of phases
bool is_active[N] = {1, 1, 1, 0}; //{1, 0, 0, 0};
broadcast chan phaseChan[N];

/*options for the synced transitions,
/should not be able to sync to itself, 
there is Extend functionality for that already
+ it deadlocks
*/
const int nextP0[N] = {1, 2, -1, -1};
const int nextP1[N] = {0, 2, -1, -1};
const int nextP2[N] = {0, 1,  3, -1};
const int nextP3[N] = {0, -1, -1, -1};

const int options[N] = {2, 2, 3, 1};
const int transitions[N][N] = {
    {0, 1, 2, -1},
    {0, 1, 2, -1},
    {0, 1, 2,  3},
    {0, 3, -1, -1}
};

// for objective
const int HORIZON = 60;
const int MIN_GREEN = 4;
clock time;
hybrid clock Q;

// helpers
int get_phase_id(bool is_active[N]){
    int i = 0; 
    for (i=0; i<N; ++i){
        if (is_active[i]){
            return i;        
        }    
    }
    return -1;
}

nta.system:
// Baseline system
// system Control, East, South, West, North, Objective;

// System 5, each phase is an instance of Phase template with syncronization channels
//P1 = Phase(0, nextP1, options[0]);
//P2 = Phase(1, nextP2, options[1]);
//system P1, P2, East, South, West, North, Objective;

// System 6, each phase is an instance of Phase template with syncronization channels
P0 = Phase(0, nextP0, options[0], is_active);
P1 = Phase(1, nextP1, options[1], is_active);
P2 = Phase(2, nextP2, options[2], is_active);
P3 = Phase(3, nextP3, options[3], is_active);

AddA = ProbAdder(A, p_move_add);
AddB = ProbAdder(B, p_move_add);
RemA = RemoverA(is_active);
RemB = RemoverB(is_active);

//system P0, P1, P2, P3; // for deadlock check
system P0, P1, P2, P3, AddA, AddB, RemA, RemB, SumSqObjective;
